import React from 'react';
import SimpleImageSlider from 'react-simple-image-slider';
import Photo1 from '../images/about_images/photo1.jpg';
import Photo2 from '../images/about_images/photo2.jpg';
import Photo3 from '../images/about_images/photo3.jpg';
import Photo4 from '../images/about_images/photo4.jpg';


const AboutPage = () => {

    const images = [
        {url: Photo1},
        {url: Photo2},
        {url: Photo3},
        {url: Photo4},
    ]

  return (
    <div className='container'>

        <SimpleImageSlider
        className='slider'
        width={400}
        height={352}
        images={images}
        showBullets={true}
        showNavs={true}
        />



    </div>
  )
}

export default AboutPage
